Contrar: retorna un long con el numero de registros que coinciden con la busqueda
 Parametros
 Solo va a tomar en cuenta listaBuscarCriterio[], pero no se deben quitar las 
 demas propiedades del objeto
 {
   "pagina":0,
   "size":5,
   "order": 0,
   "campoOrdenar": "fechaCreacion",
   "listaBuscarCriterio":[
     {"key":"email", "value":["test"], "operacion": "MATCH"}
     ,{"key":"nombre", "value":["prue"], "operacion": "MATCH"}
   ]
}

